// UserCard.js
import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import { ContextGlobal } from './ContextGlobal';

const UserCard = ({ user }) => {
  const { addFavorite } = useContext(ContextGlobal);

  const handleAddFavorite = () => {
    addFavorite(user.id);
  };

  return (
    <div className="user-card">
      <img src="url_de_la_imagen_del_doctor" alt="Doctor" />
      <h3>{user.name}</h3>
      <p>{user.username}</p>
      <button onClick={handleAddFavorite}>ADD FAV</button>
      <Link to={`/dentist/${user.id}`}>Ver detalles</Link>
    </div>
  );
};

export default Card;
